        refundableExcessOptionsPar2: "CarDelMar offers a selection of low price Coverage Packages that allow you to receive a reimbursement of your Excess/Deposit in the event that some is taken by the local car hire company for repairs after a damage. This means that the cost for the damage will first be deducted by the local car hire partner from the amount blocked on your credit card, and an invoice explaining the damage will be given to you on site, or sent to you shortly. Then, as soon as you send this document to CarDelMar, along with a credit card statement showing the amount taken for the damage, we will refund that amount to you.",
        refundableExcessOptionsHeadline3: "Recommended Coverage Package",
        refundableExcessOptionsPar3: "CarDelMar recommends at least the Coverage Package ‘Coverage with refund of excess’, which will allow us to reimburse you for the vast majority of damages to your hire car. Naturally, the more coverage you purchase, the more we are able to reimburse you.  If you are charged for glass or tyre damage, this can only be reimbursed if you have taken out ‘Coverage with refund of excess incl. glass & tyres’.",
